define(function (require, exports, module) {
    module.exports = function (tpl, view, stc, svc) {
        require('../styles/seckill.detail.css');
        var _vm = null;
        tpl.m_on("init", function () {
            _vm = this.m_vm({
                data: {
                    title: "商品详情",
                    tab_index: 0,
                    discuss_list: [],
                    page_size: 3,
                    curr_page: 1,
                    status: null,
                    swiper: {},
                    id: view.query.id,
                    dealed_pic_base64: 'data:image/png;base64,',
                    seckill_detail_desc64: '',
                    detail: {},
                    images: [],
                    start_time: "",
                    end_time: "",
                    left_time: "",
                    name: "",
                    description: ""
                },
                methods: {
                    m_load_info: function () {
                        var _data = {
                            id: _vm.id
                        };
                        app.service.seckill.m_detail(
                            _data,
                            function (res) {
                                console.log(res.data);
                                _vm.detail = res.data;
                                _vm.images = res.data.images;
                                _vm.start_time = res.data.startTime;
                                _vm.end_time = res.data.endTime;
                                _vm.left_time = _vm.end_time - _vm.start_time;
                                _vm.name = res.data.name;
                                _vm.description = res.data.description;
                            },
                            function (err) {
                                console.log("失败：" + err);
                            }
                        );
                    },

                    m_count_down: function (time, id) {
                        var day_elem = $(id).find('.day');
                        var hour_elem = $(id).find('.hour');
                        var minute_elem = $(id).find('.minute');
                        var second_elem = $(id).find('.second');

                        //if(typeof end_time == "string")
                        var end_time = new Date(time).getTime(),//月份是实际月份-1
                            sys_second = (end_time - new Date().getTime()) / 1000;
                        var timer = setInterval(function () {
                            if (sys_second > 1) {
                                sys_second -= 1;
                                var day = Math.floor((sys_second / 3600) / 24);
                                var hour = Math.floor((sys_second / 3600) % 24);
                                var minute = Math.floor((sys_second / 60) % 60);
                                var second = Math.floor(sys_second % 60);
                                day_elem && $(day_elem).text(day);//计算天
                                $(hour_elem).text(hour < 10 ? "0" + hour : hour);//计算小时
                                $(minute_elem).text(minute < 10 ? "0" + minute : minute);//计算分钟
                                $(second_elem).text(second < 10 ? "0" + second : second);//计算秒杀
                            } else {
                                clearInterval(timer);
                            }
                        }, 1000);
                    },
                }
            });
        });
        tpl.m_on('refresh', function () {

            // 调用加载接口的方法
            _vm.m_load_info();

            //
            /* 每当模板渲染时触发 */
            // if (undefined !== view.query.menberid) {
            //     app.session.m_set('parentid', view.query.menberid)
            // }
            // return _vm.m_refresh();
            _vm.m_count_down("2017/11/11 15:11:59","#colockbox1");
        });

        view.m_on("active", function () {
            /* 当 view 激活时触发(在 enter 事件之前, 简单点说如果有过度动画, 将会在过度之前触发) */
        });

        view.m_on("enter", function () {
            /* 当 view 进入时触发 */
        });

        view.m_on("frozen", function () {
            /* 当 view 失效时触发 (如果有过度动画, 将会在过度之前触发) */
        });

        view.m_on("leave", function () {
            /* 当 view 离开时触发 (如果有过度动画, 将会在过度之后触发) */
        });

        view.m_on("message", function (ev, msg) {
            /* 当 view 进入后, 从消息队列中获取消息列表, 循环触发 */
            // ev 事件源
            // msg 消息对象 属性: name, params
            switch (msg.name) {
                case "<name>": { // 监视消息名称
                    // ...
                    break;
                }
            }
        });
    }
});